private DelegationKey loadDelegationKey(byte[] data) throws IOException {
  DelegationKey key = new DelegationKey();
  DataInputStream in = new DataInputStream(new ByteArrayInputStream(data));
  try {
    key.readFields(in);
  } finally {
    IOUtils.cleanup(LOG, in);
  }
  return key;
}
